    function initPage(PathSimplifier, $) {


        var pathSimplifierIns = new PathSimplifier({
            zIndex: 100,
            //autoSetFitView:false,
            map: map, //所属的地图实例

            getPath: function(pathData, pathIndex) {

                return pathData.path;
            },
            getHoverTitle: function(pathData, pathIndex, pointIndex) {

                return null;
            }
        });

        window.pathSimplifierIns = pathSimplifierIns;

        pathSimplifierIns.setData([{
            name: '测试',
            path: lngLats
        }]);

        //initRoutesContainer(d);

        function onload() {
            pathSimplifierIns.renderLater();
        }

        function onerror(e) {
            alert('图片加载失败！');
        }

        var pathNavigatorStyles = [ {
            width: 16,
            height: 32,
            //使用图片
            content: PathSimplifier.Render.Canvas.getImageContent('http://webapi.amap.com/ui/1.0/ui/misc/PathSimplifier/examples/imgs/car.png', onload, onerror),
        }
        ];


        function extend(dst) {
            if (!dst) {
                dst = {};
            }

            var slist = Array.prototype.slice.call(arguments, 1);

            for (var i = 0, len = slist.length; i < len; i++) {
                var source = slist[i];

                if (!source) {
                    continue;
                }

                for (var prop in source) {
                    if (source.hasOwnProperty(prop)) {
                        dst[prop] = source[prop];
                    }
                }
            }
            return dst;
        }

        var idx = 0;

        var navg1 = pathSimplifierIns.createPathNavigator(0, {
            loop: true,
            speed: 5000,
            pathNavigatorStyle: extend({}, pathNavigatorStyles[0])
        });

        navg1.start();

        function changeNavgContent() {

            //获取到pathNavigatorStyle的引用
            var pathNavigatorStyle = navg1.getStyleOptions();

            //覆盖修改
            extend(pathNavigatorStyle, pathNavigatorStyles[(++idx) % pathNavigatorStyles.length]);

            //重新绘制
            pathSimplifierIns.renderLater();
        }

        setInterval(changeNavgContent, 500);
    }

    AMapUI.load(['ui/misc/PathSimplifier', 'lib/$'], function(PathSimplifier, $) {

        if (!PathSimplifier.supportCanvas) {
            alert('当前环境不支持 Canvas！');
            return;
        }

        initPage(PathSimplifier, $);

    });
